import React from "react";
import { Link } from "react-router-dom";
import logo from '../images/logo.svg';

const logoWrapper = {
    display: 'block',
    width : '150px',
    float : 'left',
    textAlign : 'center'
};

const Navigation = props => {
    return (
        <div className="container-fluid">
        <div className="row">
          {/* <nav className="navbar navbar-expand-lg navbar-light bg-light"> */}

            <div classNameName="col-md-3 col-sm-6 offset-md-0">
              <div id="myLogo">
                <p style={{float:"left", marginTop:"12px", marginRight:"12px"}}>RidhoRosa </p><img src={logo} style={{width:"30%"}}/>
              </div>
            </div>    

            <div classNameName="col-md-4 col-sm-6 offset-md-0">
              <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
              </button>
              <div className="collapse navbar-collapse" id="navbarSupportedContent" style={{fontSize:"15px"}}>
                <ul className="navbar-nav mr-auto">
                  <li className="nav-item active">
                    <a className="nav-link" href="#">Sepakbola <span className="sr-only">(current)</span></a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="#">Ekonomi</a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="#">Politik</a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="#">Liburan</a>
                  </li>
                  <li className="nav-item dropdown">
                    <a className="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                      Lainnya
                    </a>
                    <div class="dropdown-menu" aria-labelledby="navbarDropdown">
                      <a class="dropdown-item" href="#">Agama</a>
                      <a class="dropdown-item" href="#">Another action</a>
                      <div class="dropdown-divider"></div>
                      <a class="dropdown-item" href="#">Something else here</a>
                    </div>
                  </li>
                </ul>
                </div>
              </div>

              <div className="col-md-4 col-sm-12 offset-md-0">
              </div>

              <div className="col-md-2 col-sm-6 offset-md-0">
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarSupportedContent">
              <ul className="navbar-nav mr-auto">
                <li className="nav-item active">
                  <a className="nav-link" href="#" style={{fontSize:"15px"}}>Masuk <span className="sr-only">(current)</span></a>
                </li>
                <li className="nav-item">
                  <a className="nav-link" href="#" style={{fontSize:"15px"}}>Daftar</a>
                </li>
                </ul>
              </div>
              </div>
          {/* </nav> */}
        </div>
      </div>



    //    <nav id='topnav'>
    //     <div style={logoWrapper}>
    //         <img src={logo} className='App-logo' alt='logo' /> <b>ReactNews</b>
    //     </div>
    //     <ul id='topmenu'>
    //     <li className='menu'>
    //         <Link to='/signin'>SignIn</Link>
    //     </li>
    //     <li className='menu'>
    //         <Link to='/'>Home</Link>
    //     </li>
    //     <li className='menu'>
    //         <Link to='/signup'>SignUp</Link>
    //     </li>
    //     <li className='menu'>
    //         <Link to='/profile'>Profile</Link>
    //     </li>
    //     <li className='menu'>
    //         <Link to='/' onClick={() => props.postSignut()} >SignOut</Link>
    //     </li>
    //     <li className='menu'>
    //         <Link to='/news'>News</Link>
    //     </li>
    //     </ul>
    //     </nav>
    );
};

export default Navigation;
